const config = {
    screens: {
      Home: {
        path: "home/:id",
        parse: {
          id: (id) => `${id}`,
        },
      },
      Profile: {
        path: "profile/:id",
        parse: {
          id: (id) => `${id}`,
        },
      },
      Notifications: "notifications",
      Settings: "settings",
    },
  };
  
  const linking = {
    prefixes: ["demo://app"],
    config,
  };
  
  export default linking;
